window.bookSummaryJSON = "<p>A relationship with a SWAT officer would never work out - or could it?</p> <p>A band of brothers. Dangerous missions. These are the men and women of the Columbia SWAT team. With their clear focus on cleaning up the streets and protecting their town, it left no room for love. Or so they thought. </p> <p>If you love nail-biting, intense, romantic suspense listens with plenty of heat, then this collection is for you! SWAT contains material for mature listeners (18 and older) only. </p> <p>Included in this set:</p> <ul> <li><i>Dirty Tactics</i></li> <li><i>Dirty Ballistics</i></li> <li><i>Dirty Operations</i></li> </ul>"; 
